import React from "react";
import "./App.css";
import Blocks from "./componets/Blocks";

class App extends React.Component {
  state = {
    blocks: [
      {
        key: "15",
      },
    ],
  };

  render() {
    return (
      <div className="App">
        <Blocks />
      </div>
    );
  }
}

export default App;
